import Navbar from "../../components/navbar/Navbar";
import "./profile.css";
import axios from "axios";

export default function Profile() {
  const token = localStorage.getItem("token");
  useEffect(() => {
    axios
      .get("http://localhost:8000/admin/profile",{ headers:{Authorization:`B`}})
      .then((response) => {
        console.log(response);
      })
      .catch((error) => { 
        console.log(error);
      });
  }, []);
  return (
    <>
      <Navbar />
      <div className="container-fluid p-5" style={{ backgroundColor: "#f7f7fa", height: "90vh" }}>
        <div className="container-fluid border rounded  profile-div mt-5 p-0">
          <div className="bg-secondary h-25 p-1 text-center">
            <svg
              xmlns="http://www.w3.org/2000/svg"
              width="80"
              fill="white"
              class="bi bi-person-circle"
              viewBox="0 0 16 16"
            >
              <path d="M11 6a3 3 0 1 1-6 0 3 3 0 0 1 6 0" />
              <path
                fill-rule="evenodd"
                d="M0 8a8 8 0 1 1 16 0A8 8 0 0 1 0 8m8-7a7 7 0 0 0-5.468 11.37C3.242 11.226 4.805 10 8 10s4.757 1.225 5.468 2.37A7 7 0 0 0 8 1"
              />
            </svg>
          </div>
          <div className="p-5 text-center">
            <p>Username:</p>
            <p>Email:</p>
          </div>
        </div>
      </div>
    </>
  );
}
